  <div className='box-input'>
    <div className='label-texte'>{labelTexte}</div>
    <input className={classN} type={type} name={classN} />
  </div>
}
function Cv_content() {
  return <> 
    <InputPerso type={"text"} name={"nom"} classN={"inputNom"} labelTexte={"Nom"}/>
  </>
}

